import React from 'react'

const Alert = ({ alert }) => {
    return (
        alert !== null && (
            <div className={`alert alert=${alert.type}`}>
                <i className="fas fa-warning-circle"></i> { alert.msg }
            </div>
        )
    )
}

export default Alert;
